module.exports = "<h2>v0.6.1</h2>\n<h4>New features</h4>\n<ol>\n<li>Weighted Moving Average indicator PR <a href=\"https://github.com/rrag/react-stockcharts/pull/200\">#200</a>- Thank you <a href=\"https://github.com/mgeri\">@mgeri</a></li>\n<li>Triangular Moving Average indicator PR <a href=\"https://github.com/rrag/react-stockcharts/pull/204\">#204</a>- Thank you <a href=\"https://github.com/mgeri\">@mgeri</a></li>\n<li>SAR indicator</li>\n</ol>\n<h4>Bug fixes</h4>\n<ol>\n<li><a href=\"https://github.com/rrag/react-stockcharts/issues/196\">#196</a> - Add <code>clip</code> property (default = true) to <code>BarSeries</code>, <code>CandlestickSeries</code>, <code>ElderRaySeries</code>, <code>MACDSeries</code>, <code>OHLCSeries</code>, <code>OverlayBarSeries</code>, <code>PointAndFigureSeries</code>, <code>RenkoSeries</code>, <code>StackedBarSeries</code></li>\n<li><a href=\"https://github.com/rrag/react-stockcharts/issues/203\">#203</a> - Filter out bars which have invalid y values</li>\n</ol>\n<h2>v0.6.0</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li><code>EventCapture</code> is now removed. This is because starting <code>0.6</code> zoom actions can happen by drag on the x/y axis also, and that is a separate container, so having a single <code>EventCapture</code> is not possible</li>\n<li><code>CurrentCoordinate</code>, <code>MouseCoordinateX</code>, <code>MouseCoordinateY</code> no longer require an <code>id</code> prop</li>\n<li><code>TooltipContainer</code> is removed and all the tooltips (<code>OHLCTooltip</code>, <code>MovingAverageTooltip</code>)  are now moved inside the <code>Chart</code> relative to which you specify the origin. This also makes the <code>forChart</code> prop on the different <code>XXXTooltip</code> unnecessary</li>\n<li><code>ElderRaySeries</code> no longer accepts a <code>calculator</code> prop but instead an <code>accessor</code></li>\n</ol>\n<h4>New features</h4>\n<ol>\n<li>Zoom on y</li>\n<li>Pan on y</li>\n<li>Support for pan to load more data</li>\n<li>Click, Right click, Doubleclick handlers on <code>LineSeries</code> - This can serve as a model for other series</li>\n<li>Add <code>tickStrokeDasharray</code> - <a href=\"https://github.com/rrag/react-stockcharts/pull/183\">#183</a> and <a href=\"http://rrag.github.io/react-stockcharts/documentation.html#/line_scatter\">documentation</a></li>\n<li>Control the number of datapoints/px - <a href=\"https://github.com/rrag/react-stockcharts/pull/192\">#192</a></li>\n<li>Hovertooltip now autosizes based on the content - <a href=\"https://github.com/rrag/react-stockcharts/pull/189\">#189</a></li>\n<li>Smooth zoom - <a href=\"https://github.com/rrag/react-stockcharts/pull/160\">#160</a></li>\n<li>More markers for a scatter chart - <a href=\"https://github.com/rrag/react-stockcharts/pull/172\">#172</a></li>\n</ol>\n<h4>Contributors</h4>\n<p>Please welcome <a href=\"https://github.com/shprink\">@shprink</a> as a new contributor.</p>\n<h4>Internal Changes</h4>\n<ol>\n<li>Upgrade to <code>d3</code> individual modules</li>\n</ol>\n<h2>v0.5.0</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li><p>Removed <code>financeEODDiscontinuousScale</code> and replaced by a new discontinuous scale which supports both eod and intraday - Thank you <a href=\"https://github.com/brobits\">@brobits</a></p>\n<p>in <code>0.4</code></p>\n<pre><code> &lt;ChartCanvas ...\n     discontinous xScale={financeEODDiscontinuousScale()}\n     ...&gt;\n</code></pre>\n<p>in <code>0.5</code></p>\n<pre><code> &lt;ChartCanvas ...\n     xScaleProvider={discontinuousTimeScaleProvider}\n     ...&gt;\n</code></pre>\n<p><code>discontinous</code> prop is also removed. However should you choose to use any of the scales provided by d3, you can use them without any changes from <code>0.4</code></p>\n<p>in <code>0.4</code></p>\n<pre><code> &lt;ChartCanvas ...\n     xScale={d3.time.scale()}\n     ...&gt;\n</code></pre>\n<p>in <code>0.5</code></p>\n<pre><code> &lt;ChartCanvas ...\n     xScale={d3.time.scale()}\n     ...&gt;\n</code></pre>\n<p>no changes here when using an existing d3 scale, <code>xScaleProvider</code> is useful only when you have to work with a discontinuous scale</p></li>\n<li><p>Removed <code>MouseCoordinates</code>, use <code>MouseCoordinateX</code>, <code>MouseCoordinateY</code> and <code>CrossHairCursor</code> together to get similar results. Breaking out one component into multiple gave a lot more flexibility and also helps in removing the awkward props <code>yMousePointerDisplayLocation</code>, <code>yMousePointerDisplayFormat</code> from <code>Chart</code></p></li>\n<li><p>Removed <code>yMousePointerDisplayLocation</code>, <code>yMousePointerDisplayFormat</code> from <code>Chart</code>, Use <code>MouseCoordinateY</code> instead</p></li>\n<li><p>Interactive indicators are <code>svg</code> only. This is most likely a transitional change till they get rewritten again in a future version to support canvas, be on the lookout for another possibly breaking change on interactive indicators</p>\n<p>Interactive indicators are no longer placed inside a <code>Chart</code>, they live inside <code>EventCapture</code>. Placing them on top of the event capture <code>rect</code> has helped in making <a href=\"https://github.com/rrag/react-stockcharts/issues/94\">#94</a> possible</p>\n<p>in <code>0.4</code></p>\n<pre><code> &lt;ChartCanvas ...&gt;\n     &lt;Chart id={0} ...&gt;\n         ...\n         &lt;TrendLine ... /&gt;\n         ...\n     &lt;/Chart&gt;\n     ...\n     &lt;EventCapture ... /&gt;\n     ...\n &lt;/ChartCanvas&gt;\n</code></pre>\n<p>in <code>0.5</code></p>\n<pre><code> &lt;ChartCanvas ...&gt;\n     &lt;Chart id={0} ...&gt;\n         ...\n     &lt;/Chart&gt;\n     ...\n     &lt;EventCapture ... &gt;\n         &lt;TrendLine forChart={0} ... /&gt;\n     &lt;/EventCapture&gt;\n     ...\n &lt;/ChartCanvas&gt;\n</code></pre>\n<p>look for more details in the <a href=\"#/trendline\">documentation</a> page</p></li>\n</ol>\n<h4>New features</h4>\n<ol>\n<li>Support both React <code>0.14</code> and React <code>15</code></li>\n<li>Annotations for events <a href=\"https://github.com/rrag/react-stockcharts/issues/54\">#54</a> - <a href=\"#/annotations\">more details</a></li>\n<li>Buy &amp; sell signals using Annotation - <a href=\"#/ma_crossover_using_text_annotation\">more</a> <a href=\"#/ma_crossover_using_svg_shape\">details</a></li>\n<li>Labels - Look at how Chart title and axis labels <a href=\"#/annotations\">more details</a></li>\n<li>Hover tooltip - <a href=\"#/hover_tooltip\">more details</a></li>\n<li>intraday scale - <a href=\"#/intra_day_with_discontinuous_scale\">more details</a></li>\n<li>Better edge coordinate - <a href=\"https://github.com/rrag/react-stockcharts/pull/79\">#79</a> - Thank you <a href=\"https://github.com/cesardeazevedo\">@cesardeazevedo</a> -</li>\n<li>Volume profile - Refer to documentation for <a href=\"#/volume_profile\">volume profile</a> and <a href=\"#/volume_profile_by_session\">volume profile by session</a> Thank you <a href=\"https://github.com/aajtodd\">@aajtodd</a> for great documentation references</li>\n</ol>\n<h4>Contributors</h4>\n<p>I thank all the contributors for taking your time to help make this better</p>\n<ol>\n<li><a href=\"https://github.com/akinoniku\">@akinoniku</a> for <a href=\"https://github.com/rrag/react-stockcharts/pull/88\">#88</a></li>\n<li><a href=\"https://github.com/brobits\">@brobits</a> for <a href=\"https://github.com/rrag/react-stockcharts/pull/69\">#69</a></li>\n<li><a href=\"https://github.com/cesardeazevedo\">@cesardeazevedo</a> for <a href=\"https://github.com/rrag/react-stockcharts/pull/79\">#79</a>, <a href=\"https://github.com/rrag/react-stockcharts/pull/97\">#97</a></li>\n</ol>\n<p>Special thanks to\n<a href=\"https://github.com/rsklyar\">@rsklyar</a>\n<a href=\"https://github.com/iNikNik\">@iNikNik</a>\n<a href=\"https://github.com/Pinxie\">@Pinxie</a>\n<a href=\"https://github.com/WaiSiuKei\">@WaiSiuKei</a>\n<a href=\"https://github.com/itsjimbo\">@itsjimbo</a>\n<a href=\"https://github.com/cesardeazevedo\">@cesardeazevedo</a>\n<a href=\"https://github.com/aajtodd\">@aajtodd</a>\n<a href=\"https://github.com/XmelesX\">@XmelesX</a>\n<a href=\"https://github.com/raptoria\">@raptoria</a>\nfor your constant support, providing ideas for new features, suggestions for improvement and identifying defects</p>\n<h2>v0.4.0</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li><p>Drop support for React <code>0.13.x</code> and make <code>0.14.3</code> the default dependency</p></li>\n<li><p>Major changes to API.</p>\n<ul>\n<li><code>DataSeries</code> is gone</li>\n<li>all <code>indicator</code>s and <code>dataTransform</code>s are now gone, and are replaced by <code>calculator</code></li>\n<li><code>setViewRange</code>, <code>pushData</code>, <code>alterData</code> were methods you could invoke from the ref of <code>ChartCanvas</code>. These are now gone, in favor of react style props for setting them</li>\n<li><code>ChartCanvas</code> now takes (among other things)\n<ul>\n<li><code>xExtents</code> - indicates the domain of the x axis</li>\n<li><code>calculators</code> - indicates the calculators to be calculated on the data</li>\n</ul></li>\n</ul>\n<p>For a summary of changes, refer to <a href=\"https://github.com/rrag/react-stockcharts/issues/48#issuecomment-174184639\">this issue</a>. Compare the examples <a href=\"https://github.com/rrag/react-stockcharts/tree/2af0c6e763ae960d40eb6c5406b4fe0ec8da2ac2/docs/lib/charts\">before (<code>0.3</code>)</a> and <a href=\"https://github.com/rrag/react-stockcharts/tree/8386c424821907512b8e135a8a7fded3e5e09c83/docs/lib/charts\">after(<code>0.4</code></a></p></li>\n<li><p>All the <code>calculator</code>s, are written d3 style. (inspired by <a href=\"https://github.com/ScottLogic/d3fc\">d3fc</a>)</p></li>\n<li><p><code>CompareSeries</code> is gone in favor of a calculator in its place. Refer to the examples for usage</p></li>\n</ol>\n<h4>New Features</h4>\n<ol>\n<li>Implement touch support, pan and pinch zoom</li>\n<li>New Chart types Scatter, OHLC</li>\n<li>New indicators - Elder impulse, Elder Ray, Force Index, ATR</li>\n<li>Updated <code>TrendLine</code>, <code>FibonacciRetracement</code>, <code>Brush</code> to take <code>type</code> prop</li>\n<li>Change <code>StraightLine</code> to take a prop of type which defaults to <code>horizontal</code></li>\n</ol>\n<h4>Internal Changes</h4>\n<ol>\n<li>Inspired by <a href=\"https://github.com/ScottLogic/d3fc\">d3fc</a> change some of the internals</li>\n<li>add dependency <code>lodash.fattendeep</code></li>\n<li>remove dependency <code>object-assign</code></li>\n</ol>\n<h2>v0.3.1</h2>\n<h4>Changes</h4>\n<ol>\n<li>Fix <a href=\"https://github.com/rrag/react-stockcharts/issues/39\">#39</a></li>\n<li>Add eslint rules to prevent these from happening again</li>\n<li>Change <code>utils.js</code> and <code>ChartDataUtil.js</code> to use es6 exports</li>\n<li>fix <code>svg</code> for <code>Brush</code></li>\n</ol>\n<h2>v0.3.0</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li>Changes to <code>Histogram</code> to accept <code>stroke</code> as a boolean param instead of a function. the <code>stroke</code> color cannot be different from <code>fill</code></li>\n<li><code>OHLCTooltip</code> uses <code>d3.format(&quot;.4s&quot;)</code> as the format to show volume. This shows a suffix of M (Mega) for Million and G (Giga) for Billion. These are per the <a href=\"https://en.wikipedia.org/wiki/Metric_prefix\">SI-prefix</a>. You can change it to a different format by passing a prop <code>volumeFormat</code> that accepts a function taking the volume and returning a formatted string</li>\n</ol>\n<h4>Changes</h4>\n<ol>\n<li>Add new methods to <code>ChartCanvas</code></li>\n<li>Add <code>Brush</code> and <code>ClickCallback</code> interactive components</li>\n<li>Fix bug on zoom, for charts not using stockscale</li>\n<li>Change to use ES6 module exports instead of commonjs <code>module.exports = ...</code></li>\n</ol>\n<h2>v0.2.12</h2>\n<h4>Changes</h4>\n<ol>\n<li>Fixed a bug where <code>React</code> was not imported in <code>fitWidth</code></li>\n</ol>\n<h2>v0.2.11</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li>Opacity works only when using Hex colors, using color names like <code>steelblue</code> <code>red</code> <code>black</code> is not recommended. This is to address #1 in <a href=\"https://github.com/rrag/react-stockcharts/issues/22\">issue #22</a></li>\n</ol>\n<h4>Changes</h4>\n<ol>\n<li>Support for Dark theme</li>\n</ol>\n<h2>v0.2.10</h2>\n<h4>Changes</h4>\n<ol>\n<li>Create interactive indicators\n<ol>\n<li><code>FibonacciRetracement</code></li>\n<li><code>TrendLine</code></li>\n</ol></li>\n<li>Add a new prop <code>widthRatio</code> which takes values from 0 to 1 (defaults to 0.5) for <code>HistogramSeries</code> &amp; <code>CandlestickSeries</code> to control the width</li>\n<li>Add new tooltip <code>SingleValueTooltip</code></li>\n</ol>\n<h2>v0.2.9</h2>\n<h4>Changes</h4>\n<ol>\n<li>Fix the moving average stroke color bug that was introduced from <code>v0.2.8</code></li>\n<li>Initial version of Interactive indicator <code>TrendLine</code></li>\n</ol>\n<h2>v0.2.8</h2>\n<h4>Changes</h4>\n<ol>\n<li>Create a pure function instead of React Components extending PureComponent, this way the <code>componentWillReceiveProps</code> will not be called when no props are changed</li>\n<li>Stop mutating the state of <code>EventHandler</code>, instead use a separate mutable state variable to hold a list of callbacks for drawing on canvas</li>\n</ol>\n<h2>v0.2.6</h2>\n<h4>Changes</h4>\n<ol>\n<li>Use <code>save-svg-as-png</code> <code>v1.0.1</code> instead of referring from source</li>\n<li>Add onClick handler for all tooltips</li>\n<li>Change onClick handler of <code>MovingAverageTooltip</code> to provide <code>chartId, dataSeriesId, options</code></li>\n</ol>\n<h2>v0.2.5</h2>\n<h4>Changes</h4>\n<ol>\n<li>Use React 0.14.0 instead of 0.14.0-rc1</li>\n<li>Add default yAccessor to Area &amp; Line Series</li>\n<li>Add checks for defensive iteration of children</li>\n<li>Fix Kagi defect where volume is not reset</li>\n<li>Add utility method to convert hex to rgba</li>\n<li>Fix axes so svg and canvas result in near pixel perfect output</li>\n<li>Round off x of Histogram so svg and canvas look similar</li>\n<li>Change import in examples from ReStock to react-stockcharts</li>\n<li>Add zIndex as property to ChartCanvas</li>\n</ol>\n<h2>v0.2.4</h2>\n<h4>Changes</h4>\n<ol>\n<li>Fix updating data for Kagi, Renko, P&amp;F. Add examples <a href=\"https://github.com/rrag/react-stockcharts/issues/17\">#17</a></li>\n</ol>\n<h2>v0.2.3</h2>\n<h4>Changes</h4>\n<ol>\n<li>Make it work with both react 0.13.3 &amp; 0.14.0-rc1 <a href=\"https://github.com/rrag/react-stockcharts/issues/12\">#12</a></li>\n</ol>\n<h2>v0.2.2</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li>Use react &amp; react-dom 0.14.0-rc1 as dependency, added <code>peerDependency</code> to resolve <a href=\"https://github.com/rrag/react-stockcharts/issues/12\">#12</a></li>\n</ol>\n<h4>Internal changes</h4>\n<ol>\n<li>Change the way chart series are developed so <code>context</code> is not used.</li>\n</ol>\n<h2>v0.2.1</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li>Use react 0.14.0-beta3 as dependency</li>\n</ol>\n<h4>Other changes</h4>\n<ol>\n<li>Improve the handling of the chart on <a href=\"#/updating_data\">updating data</a>\n<ol>\n<li>provide a new <code>pushData</code> method to push new data points, and another <code>alterData</code> method to modify existing data. By creating these methods, it is easy to identify if a change to the Chart is due to data changes or change of height/width of the chart</li>\n</ol></li>\n<li>Add example for serverside rendering</li>\n<li>Add example for downloading chart as png - works for both canvas &amp; svg</li>\n</ol>\n<h4>Internal changes</h4>\n<ol>\n<li>In an attempt to improve performance of pan actions on firefox, the pan actions when done for canvas now do not update the state during pan. To achieve this the following changes were done\n<ol>\n<li>Create Canvas based X &amp; YAxis</li>\n<li>Canvas based <code>EdgeCoordinates</code> and <code>MouseCoordinates</code> and <code>CurrentCoordinate</code></li>\n<li>Create 2 canvas as against one for each chart.\n<ul>\n<li>One canvas that is redrawn on mouse move, this canvas contains the <code>MouseCoordinates</code>, <code>CurrentCoordinate</code>, and</li>\n<li>One canvas that is drawn on zoom or pan action, this contains everything else, including the <code>XAxis</code>, <code>YAxis</code>, the actual Chart series, <code>EdgeCoordinate</code></li>\n</ul></li>\n</ol></li>\n</ol>\n<h2>v0.2</h2>\n<h4>Breaking Changes</h4>\n<ol>\n<li><code>&lt;DataTransform&gt;</code> is now removed, Check out examples on how to use the new <code>dataTransform</code> property of <code>ChartCanvas</code></li>\n<li><code>&lt;OverlaySeries&gt;</code> is now removed, and <code>&lt;DataSeries&gt;</code> is used in its place and also it no longer accepts <code>type</code> instead accepts an <code>indicator</code> prop. This will keep the <code>OverlaySeries</code> extensible for custom overlays too. This is a significant change as it combines indicators and overlays to be interchangable. Multiple <code>DataSeries</code> in the same <code>Chart</code> contribute to the same <code>scales</code></li>\n<li><code>DataSeries</code> no longer accepts <code>xAccessor</code> instead, it is moved to <code>Chart</code>. Use of <code>xAccessor</code> on the <code>Chart</code> is for very simple usecases, since it does not benefit from the stock scale</li>\n<li>Simple moving average and Exponential moving average are converted as indicators</li>\n<li>Axes are now accesible via <code>ReStock.axes.XAxis</code>, <code>ReStock.axes.YAxis</code> against <code>ReStock.XAxis</code>, <code>ReStock.YAxis</code> in 0.1.x</li>\n<li>No more <code>react-stockchart.css</code>. The stylesheet is no longer used. All the styling has been moved to the individual components. If you prefer to have different style attributes you can use the style related  properties of the individual components or create a custom stylesheet with the class defined in each component</li>\n</ol>\n<h4>Other changes</h4>\n<ol>\n<li>Pure React based <code>svg</code> axes. Both <code>XAxis</code> and <code>YAxis</code> do not use <code>d3</code> to render inside <code>componentDidMount</code> / <code>componentDidUpdate</code></li>\n<li>Added new indicators/overlays Bollinger band, RSI, MACD</li>\n<li>A new property <code>type</code> is added to <code>ChartCanvas</code> and it takes one of 2 values\n<ul>\n<li><code>svg</code> which creates the chart using pure svg</li>\n<li><code>hybrid</code> which creates the chart using a combination of <code>svg</code> and <code>canvas</code>. <code>canvas</code> is used to draw the different series, like Line, Area, Candlestick, Histogram etc. and <code>svg</code> is used for the <code>XXXTooltip</code>, <code>MousePointer</code>, <code>XAxis</code> <code>YAxis</code> and the <code>EdgeIndicator</code></li>\n</ul></li>\n<li>add <code>jsnext:main</code> to <code>package.json</code> for use with <a href=\"https://github.com/rollup/rollup\">rollup</a></li>\n</ol>\n<hr>\n";

